def calculate_min_data_consumption_factor(n, m):
    if m < n - 1 and m > n * (n + 1) // 2:
        return -1
    elif n == 1 and m == 1:
        return 1
    elif n == 1 and m == 0:
        return 0
    elif n == 2 and m == 1:
        return 1
    elif n == 2:
        return 2
    elif m <= n + 1:
        return 2
    elif m <= 2 * n:
        return 3
    else:
        m = m - 2 * n
        ans = 3
        t1 = 2 * m // n
        t2 = 2 * m % n
        if t2:
            ans += t1 + 1
        else:
            ans += t1
        return ans

